import React, { Component } from 'react';
import './App.css'; // APP 컴포넌트의 디자인 css

class Subject extends Component {
    render() {
        return (
            <header>
                <h1>WEB</h1>
                world wide web!
            </header>
        );
    }
}

class App extends Component {
  render() {
      return (
          <div className="App">
              <Subject/>
          </div>
      );
  }
}


export default App;
